&nbsp;
[LT]a href=''javascript:SearchGrid[PageTemplateId]()'' style=''text-decoration:none;''[GT][LT]img src=''[VirtualDomain]/Images/ToolBar/x24/find.png'' width=''20'' height=''20'' /[GT][LT]span style=''position:relative;margin-right:15px;''[GT] Search[LT]/span[GT][LT]/a[GT]', N'	function SearchGrid[PageTemplateId]() {
		var grid = $(''#grid_[PageTemplateId]'').data(''kendoGrid'');
		var initialFilter = { logic: ''and'', filters: [{ field: ''HostName'', operator: ''text_contains'', value: $(''#searchHostName'').val() }, { field: ''HostName'', operator: ''text_contains'', value: $(''#searchHostName'').val() }] };
		grid.dataSource.filter(initialFilter);
	}

	function ReclaimPort() {
		var ids = "";
		$(".chk_[PageTemplateId]").each(function () {
			if (this.checked) {
				ids += "''" + $(this).attr("value") + "'',";
			}
		});

if (ids.length [GT] 0) {
   ids = ids.substring(0, ids.length - 1);
} else {
   MessageBox("Information","Select at least one record to reclaim.", false);
   return;
}


		ConfirmMessage("Warning", "DANGER!!!  This will set the ports back to an open state.   DANGER!!!![LT]br[GT]Proceed?");

		$("#dialogYesButton").click(function () {

			$.ajax({
				url: "SwitchPorts/ReclaimPorts",
				data: { ids: ids },
				dataType: "text",
				success: function (data) {
					$("#grid_[PageTemplateId]").data("kendoGrid").dataSource.read();
					$("#grid_[PageTemplateId]").data("kendoGrid").refresh();
					$("#dialogYesNo").data("kendoWindow").close();

				}
			});
		})

